    wall (non-historic) at Pipe Spring National Monument, Arizona. The wall was collected
    by a Trimble GeoXT GPS unit with external antenna, Hurricane, and post processed
    in GPS Pathfinder Office 3.0 for differential corrections. The location of the wall
    is approximate. The wall, of course, is underground. It was GPS'd by walking in
    areas of disturbed vegetation and from directions for the Maintenance Supervisor,
